import React, { useState } from 'react';
import { format } from "date-fns";
import AccountCircleIcon from '@material-ui/icons/AccountCircle'
import TextField from '@material-ui/core/TextField';
import DateRangePicker from '@material-ui/lab/DateRangePicker';
import {AdapterDateFns} from '@material-ui/lab';
import LocalizationProvider from '@material-ui/lab/LocalizationProvider';
import Box from '@material-ui/core/Box';

export default function App() {
 const [value, setValue] = React.useState([null, null]);

 return (
  <div>
    <LocalizationProvider dateAdapter={AdapterDateFns}>
      <DateRangePicker
        startText="Check-in"
        endText="Check-out"
        value={value}
        onChange={(newValue) => {
          setValue(newValue);
        }}
        renderInput={(startProps, endProps) => (
          <React.Fragment>
            <TextField {...startProps} variant="standard" />
            <Box sx={{ mx: 2 }}> to </Box>
            <TextField {...endProps} variant="standard" />
          </React.Fragment>
        )}
      />
    </LocalizationProvider>
  <div className='app'>
			<div style={{display:"flex",flexDirection:"column", padding:"10px",justifyContent:"flex-start"}}>
     <div className='score-section'>
      <AccountCircleIcon />
    No of Participants : 10
				</div>
    <div className='score-section'>
      <AccountCircleIcon />
    No of Participants in quiz 1 : 5
				</div>
    <div className='score-section'>
      <AccountCircleIcon />
    No of Participants quiz 1: 3
				</div>
    <div className='score-section'>
      <AccountCircleIcon />
     No of Participants quiz 1: 2
				</div>
    </div>
   </div>
   </div>
	);
}
